  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:02.622052\",\n\t\"name\": \"1986-moose-census-lower-nowitna-river-drainage-final-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A moose survey of the lower Nowitna drainage
  on the Nowitna National Wildlife Refuge was conducted from 17-21 November 1986.
  The 1986 population estimate for the study area is 783 u00b1 191 moose at the 90%
  confidence level. A 1980 survey in the study area estimated a population of 1390
  u00b1 373 moose. The two estimates are significantly different at the 95% confidence
  level (two-tailed Student's t-test). Sex and age composition data were collected
  during the surveys and during trend area surveys in 1982, 1983 and 1985. Calf:cow
  ratios are indicative of adequate summer survival of calves; however poor annual
  recruitment in 1983, 1985 and 1986 was reflected in low yearling bull:cow ratios.
  Poor winter survival of calves is a potential problem in the study area.\",\n\t\"license_title\":
